import React, { useState } from 'react';


function AuthPage() {
  const [isLogin, setIsLogin] = useState(true);
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    name: '',
    organization: '',
    contactEmail: ''
  });

  const toggleAuthMode = () => {
    setIsLogin(!isLogin);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement submission logic here (e.g., API call)
  };

  return (
    <div>
      <h2>{isLogin ? 'Login' : 'Signup'}</h2>
      <form onSubmit={handleSubmit}>
        {!isLogin && (
          <>
            <input type="text" name="name" placeholder="Name" onChange={handleInputChange} />
            <input type="text" name="organization" placeholder="Organization" onChange={handleInputChange} />
            <input type="email" name="contactEmail" placeholder="Contact Email" onChange={handleInputChange} />
          </>
        )}
        <input type="text" name="username" placeholder="Username" onChange={handleInputChange} />
        <input type="password" name="password" placeholder="Password" onChange={handleInputChange} />
        <button type="submit">{isLogin ? 'Login' : 'Signup'}</button>
      </form>
      <button onClick={toggleAuthMode}>
        {isLogin ? 'Go to Signup' : 'Go to Login'}
      </button>
    </div>
  );
}

export default AuthPage;
